```{.r .cell-code  code-fold="true"}
mdcr_enroll_ab_1 |> 
  dplyr::select(Year = year, 
                #total, 
                Original = original, 
                "Medicare Advantage" = ma_other) |> 
  tidyr::pivot_longer(!Year, 
                      names_to = "Type", 
                      values_to = "Enrollees") |> 
  ggplot2::ggplot(ggplot2::aes(Year, 
                               Enrollees, 
                               group = Type, 
                               fill = Type)) +
  ggchicklet::geom_chicklet(width = 0.75) +
  ggplot2::scale_fill_manual(
    name = NULL,
    values = c(
      "Medicare Advantage" = "#ae4544",
      "Economy" = "#d8cb98",
      "Climate Change" = "#a4ad6f",
      "Original" = "#cc7c3a",
      "Healthcare" = "#436f82",
      "Foreign Policy" = "#7c5981",
      "Other" = "#cccccc"
    )
    #breaks = setdiff(unique(debates2019$topic), "Other")
  ) +
  ggplot2::guides(
    fill = ggplot2::guide_legend(nrow = 1)
  ) +
  ggplot2::coord_flip() +
  ggplot2::labs(
    x = NULL, 
    y = NULL, 
    fill = NULL
  ) +
  hrbrthemes::theme_ipsum_rc(grid="X") +
  ggplot2::theme(axis.text.x = ggplot2::element_text(
    color = "gray60", 
    size = 10)) +
  ggplot2::theme(legend.position = "top")
